  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Union
  Slough NWR outlines Refuge accomplishments during the 1979 calendar year. The report
  begins with an introduction to the Refuge and information about weather conditions,
  habitat conditions, land acquisition activities, and the system status. Construction
  and maintenance are also described. Habitat management is covered; croplands, grasslands,
  wetlands, and forests are discussed. The wildlife section of the report discusses
  endangered and threatened species, migratory birds, mammals, and non-migratory birds.
  Interpretation and recreation activities are outlined; topics include information
  and interpretation, recreation, and law enforcement. Field investigations, cooperative
  programs, items of interest, safety information, and Refuge brochures are attached.\",\n\t\"owner_org\":
